import React from 'react';
import Button from '../components/Button';

class SubmitButton extends React.PureComponent {
  handleClick = () => {
    alert("submit")
  }
  render(){
    return(
      <Button onClick={this.handleClick} {...this.props} />
    )
  }
}

export default SubmitButton;
